import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  Avatar,
  Typography
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';
import { TrendingUp as TrendingUpIcon, TrendingDown as TrendingDownIcon } from '@mui/icons-material';
import { useTheme } from '@mui/material/styles';

const Row = ({ pair, columns }) => {
  const [open, setOpen] = useState(false);
  const theme = useTheme();

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  const formatNumber = (num) => {
    if (num >= 1000000) return `${(num / 1000000).toFixed(2)}M`;
    if (num >= 1000) return `${(num / 1000).toFixed(2)}K`;
    return num?.toFixed(2);
  };

  const formatPrice = (price) => {
    if (price < 0.001) return price.toFixed(8);
    if (price < 1) return price.toFixed(6);
    return price.toFixed(3);
  };

  return (
    <>
      <TableRow
        hover
        sx={{
          cursor: 'pointer',
          height: '48px',
          '& > td': {
            p: 1,
            border: 0,
            bgcolor: 'background.paper',
            fontSize: '0.875rem',
            fontFamily: 'monospace',
          },
          '&:hover': {
            '& > td': {
              bgcolor: 'background.default',
            },
          },
          mb: 0.25,
        }}
        onClick={handleRowClick}
      >
        {/* Pair Name & Icon */}
        <TableCell>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
            <IconButton
              size="small"
              className="expand-icon"
              sx={{
                p: 0.5,
                color: open ? 'primary.main' : 'text.secondary',
              }}
            >
              <KeyboardArrowDownIcon fontSize="small" />
            </IconButton>
            <Avatar 
              src={pair.logoURI} 
              alt={pair.symbol}
              sx={{ width: 20, height: 20 }}
            />
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
              <Typography sx={{ fontWeight: 500, fontSize: '0.875rem' }}>
                {pair.symbol}
              </Typography>
              <Typography 
                sx={{ 
                  color: 'primary.main',
                  bgcolor: 'primary.lighter',
                  px: 0.5,
                  py: 0.25,
                  borderRadius: 0.5,
                  fontSize: '0.75rem',
                }}
              >
                {pair.version}
              </Typography>
            </Box>
          </Box>
        </TableCell>

        {/* Price */}
        <TableCell align="right">
          <Typography sx={{ fontFamily: 'monospace', fontWeight: 500 }}>
            ${formatPrice(pair.price)}
          </Typography>
        </TableCell>

        {/* Today's Fees */}
        <TableCell align="right">
          <Typography sx={{ color: 'success.main', fontWeight: 500 }}>
            ${formatNumber(pair.todayFees)}
          </Typography>
        </TableCell>

        {/* TVL */}
        <TableCell align="right">
          <Typography sx={{ fontWeight: 500 }}>
            ${formatNumber(pair.tvl)}
          </Typography>
        </TableCell>

        {/* APR */}
        <TableCell align="right">
          <Typography sx={{ color: 'success.main', fontWeight: 500 }}>
            {pair.apr?.toFixed(2)}%
          </Typography>
        </TableCell>

        {/* Transaction Counts with colored bars */}
        {['5m', '1h', '6h', '24h'].map((period) => (
          <TableCell key={period} align="right" sx={{ minWidth: 80 }}>
            <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', gap: 1 }}>
              <Typography sx={{ fontWeight: 500, minWidth: 30 }}>
                {pair[`${period}Txns`]}
              </Typography>
              <Box sx={{ 
                width: 60,
                height: 4,
                borderRadius: 1,
                bgcolor: pair[`${period}BuySell`] > 0 ? 'success.main' : 'error.main',
              }} />
            </Box>
          </TableCell>
        ))}

        {/* Price Changes */}
        {['5m', '1h', '6h', '24h'].map((period) => (
          <TableCell key={period} align="right">
            <Typography sx={{ 
              color: (pair[`${period}Change`] || 0) >= 0 ? 'success.main' : 'error.main',
              fontWeight: 500
            }}>
              {(pair[`${period}Change`] || 0) > 0 ? '+' : ''}{(pair[`${period}Change`] || 0)?.toFixed(2)}%
            </Typography>
          </TableCell>
        ))}

        {/* Volume */}
        {['5m', '1h', '6h', '24h'].map((period) => (
          <TableCell key={period} align="right">
            <Typography sx={{ fontWeight: 500 }}>
              ${formatNumber(pair[`${period}Volume`])}
            </Typography>
          </TableCell>
        ))}

        {/* JOS Score */}
        <TableCell align="right">
          <Typography sx={{ color: 'success.main', fontWeight: 500 }}>
            {pair.josScore?.toFixed(2)}
          </Typography>
        </TableCell>

        {/* DEX */}
        <TableCell align="right">
          <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', gap: 0.5 }}>
            <Avatar 
              src={pair.dexLogo} 
              alt={pair.dex}
              sx={{ width: 16, height: 16 }}
            />
          </Box>
        </TableCell>
      </TableRow>
      <TableRow>
        <TableCell
          colSpan={20}
          sx={{
            p: 0,
            border: 0,
            bgcolor: 'background.default',
          }}
        >
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ p: 3 }}>
              <ExpandedRow pair={pair} />
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  return (
    <TableContainer
      component={Paper}
      sx={{
        boxShadow: 2,
        borderRadius: 3,
        bgcolor: 'background.default',
        p: 2,
        '& .MuiTable-root': {
          borderCollapse: 'separate',
          borderSpacing: '0 8px'
        }
      }}
    >
      <Table aria-label="pairs table">
        <TableHead>
          <TableRow
            sx={{
              '& th': {
                border: 0,
                p: 2,
                color: 'text.secondary',
                fontWeight: 600,
                fontSize: '0.75rem',
                textTransform: 'uppercase',
                letterSpacing: '0.05em',
                bgcolor: 'transparent'
              }
            }}
          >
            {columns.map((column) => (
              <TableCell
                key={column.id}
                align={column.numeric ? 'right' : 'left'}
                sortDirection={orderBy === column.id ? order : false}
                sx={{
                  cursor: 'pointer',
                  '&:hover': {
                    color: 'primary.main'
                  }
                }}
                onClick={() => handleSort(column.id)}
              >
                <TableSortLabel
                  active={orderBy === column.id}
                  direction={orderBy === column.id ? order : 'asc'}
                  sx={{
                    '& .MuiTableSortLabel-icon': {
                      opacity: 0.5
                    }
                  }}
                >
                  {column.label}
                </TableSortLabel>
              </TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {pairs.map((pair) => (
            <Row
              key={pair.address}
              pair={pair}
              columns={columns}
            />
          ))}
        </TableBody>
      </Table>
      <TablePagination
        rowsPerPageOptions={[10, 25, 50, 100]}
        component="div"
        count={totalCount}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        sx={{
          mt: 2,
          borderTop: 1,
          borderColor: 'divider',
          '& .MuiTablePagination-select': {
